import React from 'react';
import "../styles/ProjectSection.css"

function ProjectSection(props) {


    const leftPercent = props.leftPercent ? props.leftPercent : 50;

    return(
        <div class="project-section">
            <div class="project-section-column project-section-column-left" style={{width: leftPercent.toString + '%'}}>
                <div class="project-section-container">
                    {props.leftComponent}
                </div>
            </div>
            <div class="vl"></div>
            <div class="project-section-column" style={{width: leftPercent.toString + '%'}}>
                <div class="project-section-container">
                    {props.rightComponent}
                </div>
            </div>
        </div>
    );
}

export default ProjectSection;
